import styles from '../styles.module.scss';

const ClaimRewards = () => {
 return (
   <div className="container my-5">
     <div className="row">
      <div className="col-12 col-md-4 mx-auto">
        <h1 className={styles.claimTitle}></h1>
      </div>
     </div>
   </div>
 )
}

export default ClaimRewards;
